async function login(username, passwd) {
    const database = client.db('harrypottergame');
    const users = database.collection('users');

    const query = { username: username, password: passwd };

    return users.findOne(query)
}

async function signin(username, passwd, email) {
    const database = client.db('harrypottergame');
    const users = database.collection('users');

    if (await users.findOne({ username: username }) == null && await users.findOne({ email: email }) == null) {
        return users.insertOne({ username: username, password: passwd, email: email });
    }
    else {
        return null;
    }
}

async function resetPasswd(username, passwd, email) {
    const database = client.db('harrypottergame');
    const users = database.collection('users');

    if (await users.findOne({ username: username, email: email }) != null) {
        return users.updateOne({ username: username, email: email }, { $set: { username: username, password: passwd, email: email } });
    }
    else {
        return null;
    }
}

