async function getRandomCards(x, y) {

    const database = client.db('harrypottergame');
    const cards = database.collection('cards');

    var rnd = []
    rnd[0] = Math.floor(Math.random() * 4);
    rnd[1] = Math.floor(Math.random() * 4);
    while (rnd[0] == rnd[1]) {
        rnd[1] = Math.floor(Math.random() * 4);
    }
    rnd[2] = Math.floor(Math.random() * 4);
    while (rnd[0] == rnd[2] || rnd[1] == rnd[2]) {
        rnd[2] = Math.floor(Math.random() * 4);
    }
    rnd[3] = Math.floor(Math.random() * 4);
    while (rnd[0] == rnd[3] || rnd[1] == rnd[3] || rnd[2] == rnd[3]) {
        rnd[3] = Math.floor(Math.random() * 4);
    }

    homes = ["gryffindor", "hufflepuff", "ravenclaw", "slytherin"];

    var cardList = []

    for (var i = 0; i < 4; i++) {
        const aggCursor = cards.aggregate([{ $match: { home: homes[rnd[i]] } }, { $sample: { size: 11 } }]);
        for await (const doc of aggCursor) {
            cardList.push(doc);
        }
    }

    var randomCards = []

    for (var i = 0; i < 11; i++) {
        randomCards.push(await cardList[i * 4 + 0]);
        randomCards.push(await cardList[i + 11]);
        randomCards.push(await cardList[i + 22]);
        randomCards.push(await cardList[i + 33]);
    }

    var matris = getRandomMatris(x, y);

    var randomCardMatris = [];
    for (var i = 0; i < x; i++) {
        randomCardMatris[i] = [];
        for (var j = 0; j < y; j++) {
            randomCardMatris[i][j] = await JSON.parse(JSON.stringify(randomCards[matris[i][j]]));
            randomCardMatris[i][j].index = i*y+j;
        }
    }

    return randomCardMatris;
}

function getRandomMatris(x, y) {
    var arr = [];
    while (arr.length < x*y) {
        var r = Math.floor(Math.random() * x*y) + 1;
        if (arr.indexOf(r) === -1) arr.push(r);
    }

    var matris = [];
    for (var i = 0; i < x; i++) {
        matris[i] = [];
        for (var j = 0; j < y; j++) {
            if(arr[i * y + j]%2==0){
                matris[i][j] = Math.floor((arr[i * y + j]-1)/2);
            }
            else{
                matris[i][j] = Math.floor((arr[i * y + j])/2);
            }
        }
    }

    return matris;
}

